webpackJsonp([0xff60ea4a249b],{483:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Rui Oliveiras - Blog",author:"Rui Oliveiras"}},markdownRemark:{id:"C:/Users/ruioliveiras/Desktop/ruioliveiras.com/content/blog/2016-01-10-example-post.md/index.md absPath of file >>> MarkdownRemark",html:'<h1 id="an-h1-header"><a href="#an-h1-header" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>An h1 header</h1>\n<p>Paragraphs are separated by a blank line.</p>\n<p>2nd paragraph. <em>Italic</em>, <strong>bold</strong>, and <code>monospace</code>. Itemized lists\nlook like:</p>\n<ul>\n<li>this one</li>\n<li>that one</li>\n<li>the other one</li>\n</ul>\n<p>Note that --- not considering the asterisk --- the actual text\ncontent starts at 4-columns in.</p>\n<blockquote>\n<p>Block quotes are\nwritten like so.</p>\n<p>They can span multiple paragraphs,\nif you like.</p>\n</blockquote>\n<p>Use 3 dashes for an em-dash. Use 2 dashes for ranges (ex., “it’s all\nin chapters 12—14”). Three dots … will be converted to an ellipsis.\nUnicode is supported. ☺</p>\n<h2 id="an-h2-header"><a href="#an-h2-header" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>An h2 header</h2>\n<p>Here’s a numbered list:</p>\n<ol>\n<li>first item</li>\n<li>second item</li>\n<li>third item</li>\n</ol>\n<p>Note again how the actual text starts at 4 columns in (4 characters\nfrom the left side). Here’s a code sample:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code># Let me re-iterate ...\nfor i in 1 .. 10 { do-something(i) }</code></pre>\n      </div>\n<p>As you probably guessed, indented 4 spaces. By the way, instead of\nindenting the block, you can use delimited blocks, if you like:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>define foobar() {\n    print "Welcome to flavor country!";\n}</code></pre>\n      </div>\n<p>(which makes copying &#x26; pasting easier). You can optionally mark the\ndelimited block for Pandoc to syntax highlight it:</p>\n<div class="gatsby-highlight">\n      <pre class="language-python"><code><span class="token keyword">import</span> time\n<span class="token comment"># Quick, count to ten!</span>\n<span class="token keyword">for</span> i <span class="token keyword">in</span> <span class="token builtin">range</span><span class="token punctuation">(</span><span class="token number">10</span><span class="token punctuation">)</span><span class="token punctuation">:</span>\n    <span class="token comment"># (but not *too* quick)</span>\n    time<span class="token punctuation">.</span>sleep<span class="token punctuation">(</span><span class="token number">0.5</span><span class="token punctuation">)</span>\n    <span class="token keyword">print</span> i\n</code></pre>\n      </div>\n<h3 id="an-h3-header"><a href="#an-h3-header" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>An h3 header</h3>\n<p>Now a nested list:</p>\n<ol>\n<li>\n<p>First, get these ingredients:</p>\n<ul>\n<li>carrots</li>\n<li>celery</li>\n<li>lentils</li>\n</ul>\n</li>\n<li>\n<p>Boil some water.</p>\n</li>\n<li>\n<p>Dump everything in the pot and follow\nthis algorithm:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>find wooden spoon\nuncover pot\nstir\ncover pot\nbalance wooden spoon precariously on pot handle\nwait 10 minutes\ngoto first step (or shut off burner when done)</code></pre>\n      </div>\n<p>Do not bump wooden spoon or it will fall.</p>\n</li>\n</ol>\n<p>Notice again how text always lines up on 4-space indents (including\nthat last line which continues item 3 above).</p>\n<p>Here’s a link to <a href="http://foo.bar">a website</a>, to a <a href="local-doc.html">local\ndoc</a>, and to a <a href="#an-h2-header">section heading in the current\ndoc</a>. Here’s a footnote <sup id="fnref-1"><a href="#fn-1" class="footnote-ref">1</a></sup>.</p>\n<p>Tables can look like this:</p>\n<p>size  material      color</p>\n<hr>\n<p>9     leather       brown\n10    hemp canvas   natural\n11    glass         transparent</p>\n<p>Table: Shoes, their sizes, and what they’re made of</p>\n<p>(The above is the caption for the table.) Pandoc also supports\nmulti-line tables:</p>\n<hr>\n<p>keyword   text</p>\n<hr>\n<p>red       Sunsets, apples, and\nother red or reddish\nthings.</p>\n<p>green     Leaves, grass, frogs\nand other things it’s\nnot easy being.</p>\n<hr>\n<p>A horizontal rule follows.</p>\n<hr>\n<p>Here’s a definition list:</p>\n<p>apples\n: Good for making applesauce.\noranges\n: Citrus!\ntomatoes\n: There’s no “e” in tomatoe.</p>\n<p>Again, text is indented 4 spaces. (Put a blank line between each\nterm/definition pair to spread things out more.)</p>\n<p>Here’s a “line block”:</p>\n<p>| Line one\n|   Line too\n| Line tree</p>\n<p>and images can be specified like so:</p>\n<p><img src="example-image.jpg" alt="example image" title="An exemplary image"></p>\n<p>Inline math equations go in like so: $\\omega = d\\phi / dt$. Display\nmath should get its own line and be put in in double-dollarsigns:</p>\n<p>$$I = \\int \\rho R^{2} dV$$</p>\n<p>And note that you can backslash-escape any punctuation characters\nwhich you wish to be displayed literally, ex.: `foo`, *bar*, etc.</p>\n<div class="footnotes">\n<hr>\n<ol>\n<li id="fn-1">\n<p>Footnote text goes here.</p>\n<a href="#fnref-1" class="footnote-backref">↩</a>\n</li>\n</ol>\n</div>',excerpt:"An h1 header Paragraphs are separated by a blank line. 2nd paragraph.  Italic ,  bold , and  monospace . Itemized lists\nlook like: this one that one the other…",timeToRead:3,frontmatter:{date:"July 10, 2015",rawDate:"2015-07-10T23:36:56.503Z",excerpt:"This post is a example post to ilustrate the functionalities",path:"/example-post",tags:[],title:"Example Post",image:null}}},pathContext:{prev:!1,next:{excerpt:"Web Summit 2016 This year (2016) web summit was in Portugal (Lisbon). Was my first time in a conference like that. I stay in a little Hotel called Hotel of Chile with 2 stars - in the  room 404  (nice number to be in a web conference). On this three…",html:'<h1 id="web-summit-2016"><a href="#web-summit-2016" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Web Summit 2016</h1>\n<p>This year (2016) web summit was in Portugal (Lisbon). Was my first time in a conference like that.</p>\n<p>I stay in a little Hotel called Hotel of Chile with 2 stars - in the <strong>room 404</strong> (nice number to be in a web conference).</p>\n<p>On this three days i was selling the product where i’m working: <strong>Saas4saaS</strong> .</p>\n<h2 id="the-pitch-of-saas4saas-was-something-like-that"><a href="#the-pitch-of-saas4saas-was-something-like-that" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The pitch of Saas4saaS was something like that:</h2>\n<blockquote>\n<p>Saas4saas is a set of services to create software as a services.</p>\n</blockquote>\n<blockquote>\n<p>You know what is software as a service, right?</p>\n</blockquote>\n<blockquote>\n<p>So, imagine this:</p>\n</blockquote>\n<blockquote>\n<p>You in one month build the MVP of your product.\nOn this month you will concentrate on the core business of your product.</p>\n</blockquote>\n<blockquote>\n<p>After in one day integrating with Saas4saaS, you will have all the secondary\nstuff but important stuff.</p>\n</blockquote>\n<blockquote>\n<p>Things like Subscriptions, Resources limitations over the plans, User integrations with facebook, google\nAre Made but us.</p>\n</blockquote>\n<blockquote>\n<p><strong>So In one month building your MVP plus one day integrating with Saas4saaS\nYou have a professional product ready to market, ready to sell.</strong></p>\n</blockquote>\n<h2 id="pitch-results"><a href="#pitch-results" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Pitch Results</h2>\n<p>I think people like the idea and want this Saas4saaS. I will continue with more pilots tests and continue working.</p>\n<h2 id="nice-things-that-i-have-seen-on-web-summit"><a href="#nice-things-that-i-have-seen-on-web-summit" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Nice things that i have seen on web summit.</h2>\n<ul>\n<li>A email client for desktop - people still work on this? ok..</li>\n<li>A app to automatically choose what to wear, where i already see this?</li>\n<li>A app which convert legancy software to browser (they convert the interface into html, and keep running the program on its beckend servers). They show me paint on the browser, it is usefull for example for medical software</li>\n<li>The best startup ever: They make t-shirt with a swappable pocket in the front. “With the same t-shrt you can have a facebook pocket, a uber pocket, Twitter pocket - there are no limitations”   </li>\n<li>“Ican” a nice app to manage our personal goals, even if the goal is to be President of United States.</li>\n</ul>\n<h2 id="conclusion"><a href="#conclusion" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Conclusion</h2>\n<p>  <strong>I think when we are in a place like web-summit we are not in Lisbon on in Dublin.\nWe are in the world</strong></p>',id:"C:/Users/ruioliveiras/Desktop/ruioliveiras.com/content/blog/2016-11-15-web-summit/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"December 15, 2016",draft:!1,path:"/web-summit-2016",tags:[],title:"Web Summit 2016"}}}}}});
